from typing import List
from collections import Counter

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        freq = Counter(nums)
        op_2, op_3, rem = 0, 0, 0

        for count in freq.values():
            op_3 += count // 3  # number of times we can perform the 3-element deletion
            rem = count % 3  # remainder after performing 3-element deletions
            if rem == 2:
                op_2 += 1  # count how many times we can perform the 2-element deletion

        # Check if the total number of deletions is enough to remove all elements
        total_ops = op_3 + op_2
        if op_2 * 2 + op_3 * 3 < len(nums):
            return -1
        return total_ops
